import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Home from "@material-ui/icons/HomeOutlined";
// import bgImage from 'assets/img/';
import styles from "assets/jss/material-kit-react/views/componentsSections/contactStyle.js";

const useStyles = makeStyles(styles);

export default function SectionPatreon(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <div className={classes.titleContainer}>
                <h1 style={{ fontWeight: 'bold', fontSize: '12vh', paddingTop: '5vh'}}>YOU CAN CONTACT US AT</h1>
            </div>
            <div classname={classes.address} >
                <Home className={classes.homeIcon} />
            </div>
        </div>
    );
}
